					"id": "4c0e9fe4-b751-4ab4-8504-2b08d55a4a95",
					"plain": "Uni (horn removed)Large Beast, CelestialArmor Class   11     Initiative   +1   (11)  Hit Points   19   (3d10 + 3)  Speed   60 ft.    ModSaveSTR18+4+4DEX12+1+1CON13+1+1  ModSaveINT2-4-4WIS12+1+3CHA7-2-2SkillsGearDamage VulnerabilitiesDamage ResistancesDamage ImmunitiesCondition ImmunitiesSenses  Passive Perception 11 Languages: Common, Elvish, SylvanChallenge  1/2 (100 XP)  Proficiency Bonus  +2 ActionsHooves. Melee Attack Roll: +6, reach 5 ft. Hit: 9 (2d4 + 4) Bludgeoning damage. If the target is a Large or smaller creature and the horse moved 20+ feet straight toward it immediately before the hit, the target takes an extra 5 (2d4) Bludgeoning damage and has the Prone condition. ",
					"player": true,
					"statBlock": true,
